import React from 'react';
import { Box, Link, PseudoBox } from '@chakra-ui/core';

const Navbar = () => (
  <PseudoBox p="20px" borderBottom="1px solid lightgray" shadow="md">
    <Link>Rick and Morty Wiki</Link>
  </PseudoBox>
);

export default Navbar;
